import Cart from './components/Cart/Cart';
import Layout from './components/Layout/Layout';
import Products from './components/Shop/Products';

const PRODUCTS = [
  {
    title: 'Test item',
    quantity: 2,
    price: 12,
    total: 24
  },
  {
    title: 'Test item 2',
    quantity: 3,
    price: 12,
    total: 36
  },
  {
    title: 'Test item 3',
    quantity: 10,
    price: 12,
    total: 120
  }];

function App() {
  return (
    <Layout>
      <Cart />
      <Products />
    </Layout>
  );
}

export default App;
